import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { HttpClientModule } from '@angular/common/http';
import { FormsModule } from '@angular/forms';
import { HTTP_INTERCEPTORS } from '@angular/common/http';

// Components
import { AppComponent } from './app.component';
import { LoginComponent } from './login/login.component';
import { RegisterComponent } from './register/register.component';
import { TravelListComponent } from './travel-list/travel-list.component';
import { TravelDetailComponent } from './travel-detail/travel-detail.component';
import { TravelEditComponent } from './travel-edit/travel-edit.component';
import { LocationListComponent } from './location-list/location-list.component';
import { PhotoGalleryComponent } from './photo-gallery/photo-gallery.component';
import { NavbarComponent } from './navbar/navbar.component';
import { FooterComponent } from './footer/footer.component';
import { NotFoundComponent } from './not-found/not-found.component';

// Routing
import { AppRoutingModule } from './app-routing.module';

// Services
import { AuthService } from './auth.service';
import { AuthInterceptor } from './interceptors/auth.interceptor';
import { VoyageCreateComponent } from './voyage-create/voyage-create.component';
import { VoyageCardComponent } from './voyage-card/voyage-card.component';
import { ShareVoyageComponent } from './share-voyage/share-voyage.component';

@NgModule({
  declarations: [
    AppComponent,
    LoginComponent,
    RegisterComponent,
    TravelListComponent,
    TravelDetailComponent,
    TravelEditComponent,
    LocationListComponent,
    PhotoGalleryComponent,
    NavbarComponent,
    FooterComponent,
    NotFoundComponent,
    VoyageCreateComponent,
    VoyageCardComponent,
    ShareVoyageComponent
  ],
  imports: [
    BrowserModule,
    HttpClientModule,
    AppRoutingModule,
    FormsModule
  ],
  providers: [
    AuthService,
    { provide: HTTP_INTERCEPTORS, useClass: AuthInterceptor, multi: true }
  ],
  bootstrap: [AppComponent]
})
export class AppModule { }
